Horror / Thriller
90 minuten

goed

met John Corbett, Dylan McDermott en Penelope Ann Miller

De familie Solomon heeft het gehaaste leven van Chicago verruild voor het bestaan op een afgelegen boerderij in North Dakota. Temidden van de rust en de velden vol zonnebloemen, komt de 16-jarige Jess erachter hoe angstaanjagend hun isolement kan zijn wanneer zij en haar jonge broertje Ben onheilspellende geesten waarnemen die niemand anders zien kan. Niemand gelooft haar, ook niet wanneer de verschijningen gewelddadig worden. Jess wordt geconfronteerd met het duistere verleden van vorige bewoners van het huis en kan alleen maar hopen dat er naar haar geluisterd wordt voordat het te laat is.:
